import React from 'react';
import './style/HowWeDoIt.css';

const Image = 'https://images.unsplash.com/photo-150430575405DB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D';

const HowWeDoIt = () => {
  return (
    <div className="main-body">
      <div className="content-section">
          <h1>HOW WE DO IT</h1>
        <ul>
          <li className="tactical">Tactical Analysis</li>
          <li>Player Development</li>
          <li>Team Optimization</li>
          <li>Match Preparation</li>
          <li>Career Guidance</li>
        </ul>
      </div>
      <div className="image-section">
        <img src={Image} alt='let train' />
        <h2>.......WELCOME TO GREATNESS</h2>
      </div>
    </div>
  );
};

export default HowWeDoIt;
